@Continuumonsouthbeach The Grand Lobby of the North Tower at the Continuum luxury oceanfront residences in Miami Beach encapsulates the quintessential design ethos of modern contemporary living. Carefully crafted by Mirtha Arriaran of MAS Interior Design, one-of-a-kind lighting fixtures, sculptures and ornaments dazzle within the layers of natural light, complemented by colorful collections of exclusive art courtesy of local gallerist and private collector, Rudolf Budja.

Follow @Continuumonsouthbeach to discover more.

