@amresidencesmiami When imagining the Aston Martin Residences interior spaces, Aston Martin’s design team, led by EVP and Chief Creative Officer, Marek Reichman, started with the iconic automaker’s guiding principle - the love of beautiful. Following the brand’s design philosophy of perfect proportions and authentic materials, the team conceptualized the visual language of the shared spaces, including the private lobbies, fitness center and spa.

